import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import './index.css';
import Sdata from './Sdata';

function tvfCard(val) {
  return (
    <Card
      simg={Sdata[val].simg}
      sname={Sdata[val].sname}
      stitle={Sdata[val].stitle}
      slink={Sdata[val].slink}
    />
  );
}
ReactDOM.render(
  <>
    <h1 className='heading'>TVF Best Web Series</h1>
    {Sdata.map(val)}
  </>,
  document.getElementById('root')
);
